(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[70599],{70599:t=>{t.exports='<tui-notification>\n    Taiga UI watches for\n    <code>visualViewport</code>\n    changes and updates following CSS variables automatically:\n    <code>--tui-viewport-x</code>\n    <code>--tui-viewport-y</code>\n    <code>--tui-viewport-width</code>\n    <code>--tui-viewport-height</code>\n    <code>--tui-viewport-scale</code>\n</tui-notification>\n<p>\n    <button\n        tuiButton\n        type="button"\n        (click)="open.set(true)"\n    >\n        Show\n    </button>\n</p>\n<ng-template #bar>\n    <tui-app-bar>\n        <button\n            tuiButton\n            tuiSlot="left"\n            type="button"\n            (click)="open.set(false)"\n        >\n            Close\n        </button>\n        Search contacts\n    </tui-app-bar>\n    <input\n        placeholder="Search contacts"\n        tuiSearch\n        type="search"\n        class="input"\n        [(ngModel)]="search"\n    />\n</ng-template>\n<ng-template\n    [tuiSheetDialog]="open()"\n    [tuiSheetDialogOptions]="{label: bar, bar: false}"\n    (tuiSheetDialogChange)="open.set($event)"\n>\n    <div class="favorites">\n        <tui-avatar-labeled\n            *ngFor="let item of items | slice: 0 : 6"\n            [label]="item.name"\n        >\n            <tui-avatar [src]="item.avatar | tuiFallbackSrc: \'@tui.user\' | async" />\n        </tui-avatar-labeled>\n    </div>\n    <div class="items">\n        <button\n            *ngFor="let item of items | tuiFilter: filter : search"\n            tuiCell\n            type="button"\n            class="cell"\n            (click)="open.set(false)"\n        >\n            <tui-avatar [src]="item.avatar | tuiFallbackSrc: \'@tui.user\' | async" />\n            <span tuiTitle>\n                <span tuiFade>{{ item.name }}</span>\n                <span tuiSubtitle>{{ item.email }}</span>\n            </span>\n        </button>\n    </div>\n    <button\n        tuiButton\n        type="button"\n        class="button"\n        (click)="open.set(false)"\n    >\n        Add contact\n    </button>\n</ng-template>\n'}}]);